            if (one_only) {
              $(".js-detail-toggle").addClass("hidden");
              $(".folder-btn").html('<i class="icon-carret-down"></i>');
            }
            $(clickable_elements)
              .parents("li")
              .removeClass("hidden");
            $detail_vir.removeClass("hidden");
            $indicateur.html('<i class="icon-carret-up"></i>');
            $li_parent.addClass("open");
